var url = "SI_APIGEE_BI_SALES_HIST_DET_I.wsdl";
var inbound = { 'TERRITORY':{'DT_SALES_OFFICE': '', 'DT_SALES_GROUP': ''}};
  

var outbound = {'SALES_HISTORY':[]};

var sales_groups = Territories.filter(isSalesGroup);
var sales_offices = Territories.filter(isSalesOffice);
var sales_office = sales_offices[0].Territories;
var soapClient={};



function isSalesGroup(Territory) {
  if(Territory.Level == "Salon - Sales Group") {
    return Territory;
  }
}
    
function isSalesOffice(Territory) {
  if(Territory.Level == "Salon - Sales Office") {
    return Territory;
  }
}


function respond(outbound,reply) {
  console.log("done");
  return reply(outbound); 
  //return reply("done");
      
}


function getSalesHistory(request,reply) {
    
    
    
    
    console.log('main body');
    
  
    
      //loop
      //for each territory
      //strip out the SAP territory ID
      //make call to PI/BI for data
      //Add response to final response
      soap.createClient(url,{endpoint: 'https://api-dev.kaokonnections.com/XISOAPAdapter/MessageServlet?senderParty=&senderService=BS_APIGEE&receiverParty=&receiverService=&interface=SI_APIGEE_BI_SALES_HIST_DET_I&interfaceNamespace=APIGEE_BI_SALES_HISTORY_DETAIL'}, function(err,client) {
        if(err) {
          console.log(err);
            var error = Boom.badRequest('Internal Error: Cannot connect to SOAP target');
            error.output.statusCode = 500;    // Assign a custom error code
            error.reformat();
          reply.end(JSON.stringify(error));
        }
        client.setSecurity(new soap.BasicAuthSecurity('SOAP_APIGEE','test.apigee'));
        
        
        console.log('mode: ' + apigee.getMode());
        
        var cache = apigee.getCache('SFA2_SalesHistoryCache2',{
          resource: 'SFA2_SalesCacheHistory',
          scope: 'global',
          defaultTtl: 30
        });
        var territoryKey = '';

        
        //
        Async.each(sales_groups,function(element,callback){
          inbound.TERRITORY.DT_SALES_OFFICE = sales_office;
          inbound.TERRITORY.DT_SALES_GROUP = element.Territories;
          console.log("==============================================");
          console.log("==== Sales Group " + inbound.TERRITORY.DT_SALES_GROUP + " ====");
          
          territoryKey = sales_office + '_' + element.Territories;
          console.log(territoryKey);
          
          cache.get(territoryKey,function(err,data){
            if(err) {
              console.log(err);
              callback(err);
            }
            if(data) {
              console.log('use cache target');
              outbound.SALES_HISTORY.push(data);
              callback();
            }
            else {
              console.log('use back-end target');
              client.SI_APIGEE_BI_SALES_HIST_DET_I(inbound, function(err,result) {
                if(err) {
                  console.log(err);
                  fs.writeFileSync("err.log", err.body);
                  callback(err);
                }
              
                console.log(result);
                outbound.SALES_HISTORY.push(result);
                //csv conversion here
                cache.put(territoryKey,result,600);
                console.log("==============================================");
                callback();
              });    
            }
            
            
          });
          
          
        },function(err) {
          if(err) {
            console.log(err);
              var error = Boom.badRequest('Internal Error: Failed to call SOAP target');
              error.output.statusCode = 500;    // Assign a custom error code
              error.reformat();
              reply.end(JSON.stringify(error));
          }
          //reply.set({'Content-Type':'application/json'})
          //ensure any csv vs json conversion done here
          reply.end(JSON.stringify(outbound))
          //respond(outbound,reply);
        });
        
        
        
      });
 
}




